import React from 'react';

function Mirage() {

    const { status, data, error } = useQuery<Data[], any>('movies', () =>
        fetch('/api/movies').then((x) => x.json())
    );

    return (
        <div>
            <div>
                <div>
                    {data && <pre>{JSON.stringify(data, null, 2)}</pre>}
                </div>
            </div>
        </div>
    );
}

export default Mirage;
